import React from 'react';
import Footer from "../../components/Footer/Footer";
import MainHome from "../../components/MainHome/MainHome";
import Header from "../../components/Header/Header";

const UserAccount = () => {
    return (
        <div>
            <Header/>
           <UserAccount/>
            <Footer/>
        </div>
    );
};

export default UserAccount;
